import React from 'react';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Layout from "./ui/components/layout/Layout/Layout.jsx";
import HomePage from "./ui/pages/HomePage/HomePage.jsx";
import BooksPage from "./ui/pages/BooksPage/BooksPage.jsx";
import LoginPage from "./ui/pages/LoginPage/LoginPage";
import AuthorsPage from "./ui/pages/AuthorsPage/AuthorsPage";
import CountryPage from "./ui/pages/CountryPage/CountryPage";
import AuthorDetails from "./ui/components/authors/AuthorDetails/AuthorDetails";
import BookDetails from "./ui/components/books/BookDetails/BookDetails";
import CountryDetails from "./ui/components/countries/CountryDetails/CountryDetails";
import ProtectedRoute from "./utils/ProtectedRoute";



const App = () => {
    return (
        <BrowserRouter>
            <Routes>
                <Route path="/" element={<Layout />}>
                    <Route index element={<HomePage />} />
                    <Route path="user/login" element={<LoginPage />} />
                    <Route path="books" element={ <BooksPage /> }
                    />
                    <Route
                        path="books/:id"
                        element={
                            <ProtectedRoute>
                                <BookDetails />
                            </ProtectedRoute>
                        }
                    />
                    <Route
                        path="authors"
                        element={
                            <ProtectedRoute>
                                <AuthorsPage />
                            </ProtectedRoute>
                        }
                    />
                    <Route
                        path="authors/:id"
                        element={
                            <ProtectedRoute>
                                <AuthorDetails />
                            </ProtectedRoute>
                        }
                    />
                    <Route
                        path="countries"
                        element={
                            <ProtectedRoute>
                                <CountryPage />
                            </ProtectedRoute>
                        }
                    />
                    <Route
                        path="countries/:id"
                        element={
                            <ProtectedRoute>
                                <CountryDetails />
                            </ProtectedRoute>
                        }
                    />
                </Route>
            </Routes>
        </BrowserRouter>
    );
};


export default App
